import React from "react";
import img1 from '../images/arijit.png';
import img2 from '../images/aujla.png';
import img3 from '../images/shreya.png';
import img4 from '../images/neha.png';

const Live=()=>{

    return(
        <div>
            <div className="Fir">
                
                <img src={img1} alt=""/>
                <img src={img2} alt=""/>
            </div>


            <div>
                
                <img src={img3} alt=""/>
                <img src={img4} alt=""/>
            </div>

        </div>
    )
}
export default Live;
